import React, { Component } from "react";

class BugRow extends Component {
  render() {
    return (
      <tr className="critterRow">
        <td>{this.props.bug.name}</td>
        <td>{this.props.bug.price}</td>
        <td>{this.props.bug.location}</td>
        {this.props.bug.schedule.allDay ? (
          <td>All Day</td>
        ) : (
          <td>{this.props.bug.schedule.startingTime}:00 - {this.props.bug.schedule.endingTime}:00</td>
        )}
      </tr>
    );
  }
}

export default BugRow;
